css:
html {
  background-color: #fafafa;
}
body {
  padding: 0;
  background-color: transparent;
}
.spec-reporter-container {
  position: fixed;
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
  z-index: 99999;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
}
.spec-reporter {
  flex: 1 1 0;
  overflow-y: auto;
  font-size: 11px;
  line-height: 1.6em;
  color: #333;
  background-color: #fafafa;
}
@media (min-height: 578px) {
  .spec-reporter {
    flex: 0 1 75%;
    min-height: 578px;
  }
}
.spec-reporter .list-unstyled {
  list-style: none;
}
.spec-reporter .reload-button {
  color: #333;
  background-color: #fff;
  border: 1px solid #ccc;
}
.spec-reporter .reload-button:hover {
  background-color: #ddd;
  color: #222;
}
.spec-reporter .symbol-header {
  font-size: 18px;
  font-weight: bold;
  padding-bottom: 10px;
}
.spec-reporter .symbol-area {
  padding: 10px;
}
.spec-reporter .symbol-summary {
  overflow: hidden;
  margin: 0;
}
.spec-reporter .symbol-summary li {
  font-family: Monaco, Consolas, monospace;
  float: left;
  line-height: 10px;
  height: 10px;
  width: 10px;
  font-size: 10px;
}
.spec-reporter .symbol-summary li.passed {
  color: #5cb85c;
}
.spec-reporter .symbol-summary li.failed {
  color: #d9534f;
}
.spec-reporter .symbol-summary li.skipped {
  color: #f0ad4e;
}
.spec-reporter .symbol-summary li.pending {
  color: #eee;
}
.spec-reporter .symbol-summary li::before {
  content: "\02022";
}
.spec-reporter .status {
  font-size: 20px;
  line-height: 2em;
  padding: 5px;
  border-radius: 0;
  text-align: center;
}
.spec-reporter .status .spec-count {
  float: left;
}
.spec-reporter .status .time {
  float: right;
}
.spec-reporter .results {
  padding: 10px;
}
.spec-reporter .results .description {
  font-size: 16px;
  padding: 5px 0 5px 0;
}
.spec-reporter .results > .suite {
  margin-bottom: 20px;
}
.spec-reporter .results > .suite > .description {
  font-size: 18px;
  font-weight: bold;
}
.spec-reporter .results .spec {
  margin-top: 5px;
  padding: 0 10px 10px 10px;
  border-left: 3px solid #d9534f;
}
.spec-reporter .results .spec .spec-toggle {
  float: right;
  cursor: pointer;
  opacity: 0;
  color: #999;
}
.spec-reporter .results .spec .spec-toggle::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f0cc";
}
.spec-reporter .results .spec .spec-toggle.folded::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f039";
}
.spec-reporter .results .spec .spec-toggle:hover {
  color: #333;
}
.spec-reporter .results .spec:hover .spec-toggle {
  opacity: 1;
}
.spec-reporter .results .suite > .suite,
.spec-reporter .results .suite > .spec {
  margin-left: 10px;
}
.spec-reporter .result-message {
  font-size: 16px;
  font-weight: bold;
  color: #d9534f;
  padding: 5px 0 5px 0;
}
.spec-reporter .result-message.deprecation-message {
  font-weight: normal;
  color: #c77c11;
  line-height: 1.4;
}
.spec-reporter .result-message.deprecation-message a {
  color: #df8a13;
}
.spec-reporter .result-message.deprecation-message code {
  color: #c77c11;
  background: #fef9f3;
}
.spec-reporter .stack-trace {
  font-size: 12px;
  margin: 5px 0 0 0;
  border-radius: 2px;
  line-height: 18px;
  color: #666;
  border: 1px solid #ddd;
  overflow: auto;
}
.spec-reporter .tooltip .tooltip-inner {
  border: 1px solid #ccc;
  background: #fff;
  color: #666;
  max-width: 400px;
}
.spec-reporter .tooltip.in {
  opacity: 1;
}
.spec-reporter .tooltip .tooltip-arrow {
  visibility: hidden;
}
.spec-reporter .result-message.fail,
.spec-reporter .stack-trace.padded {
  text-overflow: ellipsis;
  display: -webkit-box;
  -webkit-box-orient: vertical;
  -webkit-line-clamp: 10;
  overflow: hidden;
}
.spec-reporter .result-message.fail.expanded,
.spec-reporter .stack-trace.padded.expanded {
  -webkit-line-clamp: inherit;
}
.spec-reporter .deprecation-toggle {
  float: right;
  cursor: pointer;
  opacity: 0;
  color: #999;
}
.spec-reporter .deprecation-toggle::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f0cc";
}
.spec-reporter .deprecation-toggle.folded::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f039";
}
.spec-reporter .deprecation-toggle:hover {
  color: #333;
}
.spec-reporter:hover .deprecation-toggle {
  opacity: 1;
}
